  false,\n\t\"url\": null,\n\t\"notes\": \"Sanborn Map Company completed the original
  classification of the multiple return LiDAR of Berkeley County, South Carolina in
  2009. In 2013, Dewberry was tasked with reviewing and updating the original LiDAR
  product. The nominal point spacing for this project is 1.4 meters. Dewberry used
  proprietary procedures to update and reclassify the LAS according to updated project
  specifications: 1-Unclassified, 2-Ground, 7-Noise,8- Model Key Points, 9-Water,
  10-Ignored Ground, 13- Points removed from bridges and culverts (which were moved
  to class 15 at OCM).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
